Defendant Emily M Gabel in court with attorney Samuel W. Benedict.  Timothy Suha appeared for the State of Wisconsin. Case called for sentencing hearing. State presents recommendation. Defense presents arguments. Court imposed the following sentence:


IMPOSED AND STAYED SENTENCE OF:  on each count consecutive to each other 

6 YEARS IMPRISONMENT  (atty. to submit letter with any jail credit)
  -  3 YEAR(S) OF INITIAL CONFINEMENT
  -  3 YEAR(S) OF EXTENDED SUPERVISION;

TERM OF PROBATION:  5 YEAR(S);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with any co-actor, victims or their residences 
*DNA sample to be provided if not yet previously done.
*Not to use or possess any dangerous weapons

*Must do 75 hours of community service each year of her probation
 
RESTITUTION:  $10,952.98 (to Brian Scarberry), $1000 (toPhillip/Laura Eidler), $3903.00 (to Nancy/Carl Trimble)  (to be paid as a condition of probation - restitution to be paid before costs or fines);
Restitution is joint and several 

COURT COSTS:  $268.00 on each count (to be paid as a condition of probation);

DNA SURCHARGE:  $250.00 on each count (to be paid as a condition of probation);

CONDITION TIME: 6 months huber for work and child care. Sentence to commence 09/02/2015 by 6 pm

IF REVOKED:
Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
